import "./About.css";
import profile_pic_nam from '../assets/profile_pic_name.jpg';
export default class About extends Component {
  render() {
    return (
      <div>
        <p>Design your About me page </p> 
        

       <div>
       <div class="split left">
         <div className="centered">
           <img 
             className="profile_image"
             src= "/assets/profile_pic_name.jpg"
             // Image goes here
             alt="Profile Pic"
             ></img>
         </div>
       </div>
       <div className="split right">
         <div className="centered">
           <div className="name_title">Anwuli Ajabor</div>
           <div className="brief_description">
             <p> I am a rising Sophmore in Florida institute of technology. <br> </br> I like music and dancing</p>
             // Details about you goes here
             </div>
           </div>
         </div>
       </div>
     </div>
   
    )
  }
}
